// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awCommandPanelSectionRenderFunction } from 'js/AwCommandPanelSectionService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwCommandPanelSectionService', () => import('js/AwCommandPanelSectionService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awCommandPanelSectionRenderFunction",
            "deps": "js/AwCommandPanelSectionService"
        }
    },
    "data": {
        "config": {
            "collapsed": null
        }
    },
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "caption": {
            "type": "string"
        },
        "name": {
            "type": "string"
        },
        "anchor": {
            "type": "object"
        },
        "commands": {
            "type": "object"
        },
        "context": {
            "type": "object"
        },
        "collapsed": {
            "type": "string"
        }
    },
    "_viewModelId": "AwCommandPanelSection",
    "_uniqueViewModelId": "AwCommandPanelSection",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awCommandPanelSectionRenderFunction, undefined, ctxImportObj );

export default Component;
